import Input from './Input'
import Button from './Button'
const LoginPage = () => {

  const inputHandler = (e) => {
    e.preventDefault()
    console.log('typed', e.target)
  }
  return (
    <form>
      <legend>Login JustSwap.it</legend>
      <Input id="username" label="Username" onChange={inputHandler} />
      <Input id="password" label="Password" onChange={inputHandler} />
      <Button text="Login" />
    </form>
  )
}

export default LoginPage
